import React from 'react';
import PropTypes from 'prop-types';
import Merch from './Merch';

function MerchList(props){
  return (
    <React.Fragment>
      <hr />
      {props.merchList.map((merch))}
    </React.Fragment>
  )

}

export default MerchList;
